('navigation', 119, 11, 'node/add/guifi-node', 'node/add/guifi-node', 'Guifi.net node', 'a:1:{s:10:"attributes";a:1:{s:5:"title";s:211:"Create a node. A node is a physical location (will be dynamically drawed on the maps using lat/lon coordinates) where there are network devices, servers, etc.<br />Every node have to be assigned to a guifi zone.";}}', 'system', 0, 0, 0, 0, 0, 2, 0, 11, 119, 0, 0, 0, 0, 0, 0, 0, 0),
