('navigation', 121, 11, 'node/add/guifi-zone', 'node/add/guifi-zone', 'Guifi.net zone', 'a:1:{s:10:"attributes";a:1:{s:5:"title";s:747:"Create a community, area or zone. A typical zone hierarchy can be related to the territory (Country/Region/City...) but not have to, i.e. a single city can have many groups or communities with distinct IP addressing policies.<br />Every zone will have it''s own page so it can be used as the homepage of that community.<br />The zones must belong at least to the root zone, but can also belong to other zones, so in that way a hierarchy is created.<br />Every zone have its own properties like maps or ip ranges and every node will have to be assigned to an existing zone, and will inherit the zone properties like his IP address and drawn in the corresponding map.<br />If zone properties are leaved blank, will inherit the parent zone properties.";}}', 'system', 0, 0, 0, 0, 0, 2, 0, 11, 121, 0, 0, 0, 0, 0, 0, 0, 0),
