('node/add', '', '', '_node_add_access', 'a:0:{}', 'node_add_page', 'a:0:{}', 3, 2, '', 'node/add', 'Create content', 't', '', 6, '', '', '', 1, 'modules/node/node.pages.inc'),
('node/add/guifi-node', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:10:"guifi_node";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/guifi-node', 'Guifi.net node', 'check_plain', '', 6, '', 'Create a node. A node is a physical location (will be dynamically drawed on the maps using lat/lon coordinates) where there are network devices, servers, etc.<br />Every node have to be assigned to a guifi zone.', '', 0, 'modules/node/node.pages.inc'),
('node/add/guifi-service', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:13:"guifi_service";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/guifi-service', 'Guifi.net service', 'check_plain', '', 6, '', 'Create a service. A service is any resource available on the network that should be listed in the content directory of the site, like a web server, internet proxy,ntp, instant messaging, voip gateway, etc... .', '', 0, 'modules/node/node.pages.inc'),
('node/add/guifi-zone', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:10:"guifi_zone";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/guifi-zone', 'Guifi.net zone', 'check_plain', '', 6, '', 'Create a community, area or zone. A typical zone hierarchy can be related to the territory (Country/Region/City...) but not have to, i.e. a single city can have many groups or communities with distinct IP addressing policies.<br />Every zone will have it''s own page so it can be used as the homepage of that community.<br />The zones must belong at least to the root zone, but can also belong to other zones, so in that way a hierarchy is created.<br />Every zone have its own properties like maps or ip ranges and every node will have to be assigned to an existing zone, and will inherit the zone properties like his IP address and drawn in the corresponding map.<br />If zone properties are leaved blank, will inherit the parent zone properties.', '', 0, 'modules/node/node.pages.inc'),
('node/add/page', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"page";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/page', 'Page', 'check_plain', '', 6, '', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 0, 'modules/node/node.pages.inc'),
('node/add/story', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:5:"story";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/story', 'Story', 'check_plain', '', 6, '', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 0, 'modules/node/node.pages.inc'),
